import React from "react";
import { Form, Input } from "antd";

const LoginForm = () => {
  return (
    <Form>
      <div>
        <label htmlFor="user-id">아이디</label>
        <br />
        <Input name="user-id"></Input>
      </div>
      <div></div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default LoginForm;
